//Import el hook de Auth0
import AppFrame from '../components/AppFrame'

const CityPage = props => {
    const city = "Madrid"
    const history = useHistory();
    const onClickHandlerHome =()=>{
        history.push('./')
    }
    return (
        <AppFrame>
            <Grid container
                justify="space-around"
                direction="colum"
                spacing={2}>
                <Grid item container
                    xs={12}
                    justify="center"
                    alignItems="flex-end">
                </Grid>

                <Grid item xs={12}>

                </Grid>
