                            borderRadius: 35,
                            backgroundColor: "#21b6ae",
                            padding: "18px 36px",
                            fontSize: "18px"
                        }}
                            size="large"
                            variant="contained"
                            onClick={onClickHandlerInfo}>
                                            Informacion>Ir a main</Button>
                    </Grid>
                </Grid>
            </Grid >
        </AppFrame>

    )
}

export default CityPage
